import React from 'react';
import axios from 'axios';
import * as config from "../services/config";

class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            users: []
        };
    }

    componentDidMount() {
        let userAccounts = [];
        axios.get(config.userAccountManagementBackendUrl)
            .then(res => {
                console.log(res)
                userAccounts = res.data;
            }).catch((err) => {
            console.log(err)
        });

        this.setState({
            users: userAccounts
        });
        console.log(this.state.users)
    }

    render() {
        const items = this.state.users.map(user => <li>{user}</li>);
        return(
            <div>{items}</div>
        )
    }
}

export default Main;
